@keyframes door-left {
  from {
    transform: translateX(0);
  }
  to {
    transform: translateX(-100%);
  }
}

.animate-door-left {
  animation: door-left 0.5s ease-in-out;
}

@keyframes door-right {
  from {
    transform: translateX(0);
  }
  to {
    transform: translateX(100%);
  }
}

.animate-door-right {
  animation: door-right 0.5s ease-in-out;
}

@keyframes fade-in-up {
  from {
    opacity: 0;
    transform: translateY(20px);
  }
  to {
    opacity: 1;
    transform: translateY(0);
  }
}

.animate-fade-in-up {
  animation: fade-in-up 0.5s ease-in-out;
}

@keyframes breathe {
  0%,
  100% {
    transform: scale(1);
  }
  50% {
    transform: scale(1.05);
  }
}

.animate-breathe {
  animation: breathe 0.5s ease-in-out;
}

@keyframes door-peek-left {
  0%,
  100% {
    transform: translateX(0);
  }
  50% {
    transform: translateX(-30px);
  }
}

.animate-door-peek-left {
  animation: door-peek-left 0.5s ease-in-out;
}

@keyframes door-peek-right {
  0%,
  100% {
    transform: translateX(0);
  }
  50% {
    transform: translateX(30px);
  }
}

.animate-door-peek-right {
  animation: door-peek-right 0.5s ease-in-out;
}

@keyframes party-glow {
  0%,
  100% {
    opacity: 0;
  }
  50% {
    opacity: 0.3;
  }
}

.animate-party-glow {
  animation: party-glow 0.5s ease-in-out;
}

