--font-sans: "Inter", "Inter Fallback", system-ui, -apple-system, sans-serif;
--font-serif: "Playfair Display", "Playfair Display Fallback", Georgia, serif;
--font-custom-2: "Geist Mono", "Geist Mono Fallback";

@keyframes confetti {
  0% {
    transform: translateY(-10%) rotate(0deg);
    opacity: 1;
  }
  100% {
    transform: translateY(100vh) rotate(720deg);
    opacity: 0;
  }
}

.animate-confetti {
  animation: confetti 0.5s ease-in-out;
}

@keyframes shimmer {
  0% {
    transform: translateX(-100%);
  }
  100% {
    transform: translateX(100%);
  }
}

.animate-shimmer {
  animation: shimmer 0.5s ease-in-out;
}

@keyframes compass-spin {
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(360deg);
  }
}

.animate-compass-spin {
  animation: compass-spin 0.5s ease-in-out;
}

